import { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Offcanvas from 'react-bootstrap/Offcanvas';
import './offcanvas.css';

export const OffCanva =() => {
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  return (
    <>
      <Button variant="primary" onClick={handleShow}>
        Launch
      </Button>

      <Offcanvas show={show} onHide={handleClose}>
        <Offcanvas.Header closeButton className='d-flex justify-content-center'>
          <Offcanvas.Title>13VENTUREs</Offcanvas.Title>

        </Offcanvas.Header>
        <Offcanvas.Body className='heading'>
         <ul>
            <li>Business Model Canvas</li>
            <li>Lean Canvas</li>
            <li>Business Envoirment Canvas</li>
            <li>Maeket Context Canvas</li>
            <li>Value Proposition Canvas</li>
            <li>Empathy Canvas</li>
            <li>Personal Building Canvas</li>
            <li>Value Chain Mapping Canvas</li>
            <li>Competitor Canvas</li>
            <li>Journey Mapping Canvas</li>
            <li>Market Sizzing Canvas</li>
         </ul>
        </Offcanvas.Body>
      </Offcanvas>
    </>
  );
}
